import React from 'react'

const Alert = ({ alert }) => {
    return (
        alert !== null && (
        <div className={`alert alert-${alert.type}`}>
        <i class="fa fa-exclamation-triangle" aria-hidden="true"/> {alert.msg}
        </div>
        )
    );
};
export default Alert;
